import React from "react";
const Header = (props) => {
    return (
     <header>     
     <nav>
        <div className="holder">
            <img src="../images/logo7.png" width="100" alt="MiLogo"/>
        </div>
        <div className="nav-links">
            <a href="../src/components/Contacto.js">Contacto</a>
            <a href= "../src/components/SobreMi.js">Sobre Mi</a>
            <a href= "../src/components/Tienda.js">Tienda</a>
            <a href= "../src/components/Carrito.js">Carrito</a>
        </div>
    </nav>             
     </header>
    )
}
export default Header;
